import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const ReservarTaller = () => {
  const navigate = useNavigate();
  const [taller, setTaller] = useState({
    id: 1,
    nombre: "Taller de Cocina Italiana",
    descripcion: "Aprende las técnicas tradicionales de la cocina italiana...",
    cuposDisponibles: 5,
    cuposTotales: 15
  });
  const [reservado, setReservado] = useState(false);
  const [yaReservado, setYaReservado] = useState(false);
  const [cargando, setCargando] = useState(false);

  // Simular verificación de reserva previa (reemplazar con llamada a API real)
  useEffect(() => {
    const verificarReserva = async () => {
      // Aquí iría la llamada a tu API Flask
      // const response = await fetch(`/api/reservas/verificar?tallerId=${taller.id}`);
      // const data = await response.json();
      // setYaReservado(data.yaReservado);
      
      // Simulación:
      setYaReservado(false); // Cambiar a true para probar el estado "ya reservado"
    };
    
    verificarReserva();
  }, [taller.id]);

  const handleReservar = async () => {
    setCargando(true);
    
    try {
      // Simular llamada a API (reemplazar con tu endpoint real)
      // const response = await fetch('/api/reservas', {
      //   method: 'POST',
      //   headers: { 'Content-Type': 'application/json' },
      //   body: JSON.stringify({ tallerId: taller.id })
      // });
      
      // Simulación de éxito:
      setTimeout(() => {
        setReservado(true);
        setTaller(prev => ({ ...prev, cuposDisponibles: prev.cuposDisponibles - 1 }));
        setCargando(false);
      }, 1000);
      
    } catch (error) {
      console.error("Error al reservar:", error);
      setCargando(false);
    }
  };

  // Estilos (se mantienen igual)
  const styles = { /* ... tus estilos actuales ... */ };

  // Nuevos estilos para los mensajes
  const messageStyles = {
    success: {
      backgroundColor: '#F0FFF4',
      color: '#6B8E23',
      padding: '15px',
      borderRadius: '8px',
      marginBottom: '20px',
      border: '1px solid #C6F6D5',
      textAlign: 'center'
    },
    error: {
      backgroundColor: '#FFF5F5',
      color: '#D94F4F',
      padding: '15px',
      borderRadius: '8px',
      marginBottom: '20px',
      border: '1px solid #FED7D7',
      textAlign: 'center'
    },
    info: {
      backgroundColor: '#EBF8FF',
      color: '#3182CE',
      padding: '15px',
      borderRadius: '8px',
      marginBottom: '20px',
      border: '1px solid #BEE3F8',
      textAlign: 'center'
    }
  };

  return (
    <div style={styles.mainContainer}>
      {/* Menú de navegación (se mantiene igual) */}
      <nav style={styles.nav}>{/* ... */}</nav>

      {/* Contenido centrado */}
      <div style={styles.contentContainer}>
        <div style={styles.card}>
          <div style={styles.header}>
            <h1 style={{ margin: 0, fontSize: '24px', fontWeight: 'bold' }}>
              RESERVAR TALLER
            </h1>
          </div>
          
          <div style={styles.content}>
            {/* Mensajes de estado */}
            {reservado && (
              <div style={messageStyles.success}>
                ¡Reserva confirmada! Has sido registrado en el taller.
              </div>
            )}
            
            {yaReservado && (
              <div style={messageStyles.error}>
                Ya tienes una reserva para este taller.
              </div>
            )}
            
            {taller.cuposDisponibles <= 0 && !reservado && (
              <div style={messageStyles.error}>
                Lo sentimos, no hay cupos disponibles para este taller.
              </div>
            )}
            
            {taller.cuposDisponibles > 0 && !yaReservado && !reservado && (
              <div style={messageStyles.info}>
                Cupos disponibles: {taller.cuposDisponibles}/{taller.cuposTotales}
              </div>
            )}

            <div style={styles.tallerInfo}>
              <h2 style={styles.tallerTitle}>{taller.nombre}</h2>
              <p style={styles.tallerDesc}>{taller.descripcion}</p>
            </div>
            
            {!reservado && !yaReservado && taller.cuposDisponibles > 0 && (
              <button
                style={styles.button}
                onClick={handleReservar}
                disabled={cargando}
                onMouseEnter={(e) => !cargando && (e.target.style.backgroundColor = styles.buttonHover.backgroundColor)}
                onMouseLeave={(e) => !cargando && (e.target.style.backgroundColor = styles.button.backgroundColor)}
              >
                {cargando ? 'Procesando...' : 'Confirmar Reserva'}
              </button>
            )}
            
            {reservado && (
              <button
                style={{ ...styles.button, backgroundColor: '#6B8E23' }}
                onClick={() => navigate('/mis-reservas')}
              >
                Ver mis reservas
              </button>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ReservarTaller;
